DELIMITER $$
--
-- Procedimentos
--
CREATE DEFINER=`admin`@`%` PROCEDURE `STP_Report_Dashboard` (IN `_start` DATETIME, IN `_end` DATETIME)   BEGIN
    SELECT status as Type,
           COUNT(1) as Count
    FROM `analyze` a
     WHERE a.created_at >= _start
     AND a.created_at <= _end
    GROUP BY status;
END$$

CREATE DEFINER=`admin`@`%` PROCEDURE `STP_Report_Graph` (IN `_start` DATETIME, IN `_end` DATETIME)   BEGIN
    SELECT a.created_at as Date, COUNT(*) as Count
    FROM `analyze` a
    WHERE created_at >= _start
    AND created_at <= _end
    GROUP BY DATE(created_at);
END$$

CREATE DEFINER=`admin`@`%` PROCEDURE `STP_Report_Pie` (IN `_start` DATETIME, IN `_end` DATETIME)   BEGIN
    SELECT count(1) as count, status as type
    FROM `analyze` a
    WHERE a.created_at >= _start
    AND a.created_at <= _end
GROUP BY status order by status;
END$$

CREATE DEFINER=`admin`@`%` PROCEDURE `STP_Request_Dashboard` ()   BEGIN
    SELECT count(1) as count, status as type
    FROM `request` r
    WHERE r.type != 'report'
GROUP BY status order by status;
END$$

DELIMITER ;

